import React, { Component } from 'react';
import 'normalize.css';
import './App.scss';
import Weather from './modules/Weather.js';
import Time from './modules/Time.js';
import Calendar from './modules/Calendar.js';
import Feed from './modules/Feed.js';
import Subway from './modules/Subway.js';
import io from "socket.io-client";
import TimeImage from './images/gallivantinglife-1150870-unsplash.jpg'

class App extends Component {
  socket = io("localhost:3001");

  render() {
    console.log(process.env);
    return (
      <div className="App">
        <Time socket={this.socket} image={TimeImage} color="#313131" />
        <Weather socket={this.socket} color="white" />
        <Calendar socket={this.socket} color="#F6A44D" calendar="nick@iamnickvolpe.com" />
        <Calendar socket={this.socket} color="#F86A68" calendar="7afrbvotf8p1qcjcpbqp2639as@group.calendar.google.com" />
        <Calendar socket={this.socket} color="#AC79CA" calendar="jenn.sager@gmail.com" />
        <Feed socket={this.socket} color="white" />
        <Subway socket={this.socket} color="#313131" />
      </div>
    )
  }
}

export default App;
